import {
  Divider,
  Drawer,
  FormControl,
  InputLabel,
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  MenuItem,
  Select,
  TextField,
  Toolbar,
} from "@mui/material";
import { Box } from "@mui/system";

export const Sidebar = () => {
  return (
    <Drawer
      sx={{
        width: "300px",
        flexShrink: 0,
        "& .MuiDrawer-paper": {
          width: "300px",
          boxSizing: "border-box",
        },
      }}
      variant="permanent"
      anchor="left"
    >
      <Toolbar />

      <Box sx={{ overflow: "auto" }}>
        <List>
          <p>Filters</p>

          <ListItem key="geograhic-resolution">
            <FormControl fullWidth>
              <TextField label="Geographic Resolution" select>
                <MenuItem value={"states"}>US States</MenuItem>
                <MenuItem value={"counties"}>US Counties</MenuItem>
              </TextField>
            </FormControl>
          </ListItem>
        </List>
      </Box>
    </Drawer>
  );
};
